MathJax.Localization.addTranslation("sv","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax anv\xE4nder webb-baserade teckensnitt f\xF6r att visa matematik p\xE5 denna sida.  Dessa tar tid att ladda ner, sidan skulle g\xF6ra snabbare om du installerar matematik-typsnitt direkt i systemets teckensnittsmapp.",imageFonts:"MathJax anv\xE4nder sina bild-teckensnitt ist\xE4llet f\xF6r lokala eller webb-baserade typsnitt. Detta kommer att g\xF6ra visningen saktare \xE4n vanligt, matematik kan \xE4ven komma att inte skrivas ut med din skrivares fulla uppl\xF6sning.",noFonts:"MathJax kan inte hitta ett typsnitt f\xF6r att visa sin matematik, och bild-teckensnitt \xE4r ej tillg\xE4ngliga, s\xE5 den faller tillbaka p\xE5 generiska Unicode-tecken i hopp om att din webbl\xE4sare kommer att kunna visa dem. Vissa tecken kan komma att visas inkorrekt, eller kanske inte alls.",webFonts:"De flesta moderna webbl\xE4sare till\xE5ter teckensnitt att h\xE4mtas via webben. Att uppdatera till en nyare version av din webbl\xE4sare (eller byta webbl\xE4sare) kan f\xF6rb\xE4ttra kvaliteten p\xE5 matematik p\xE5 denna sida.",fonts:"MathJax kan antingen anv\xE4nda [STIX-typsnitt](%1) eller [MathJax TeX-typsnitt](%2). Ladda ner och installera en av dessa typsnitt f\xF6r att f\xF6rb\xE4ttra din MathJax-upplevelse.",STIXPage:"Denna sida \xE4r designad f\xF6r att anv\xE4nda [STIX-typsnitt](%1). Ladda ner och installera dessa typsnitt f\xF6r att f\xF6rb\xE4ttra din MathJax-upplevelse.",TeXPage:"Denna sida \xE4r designad f\xF6r att anv\xE4nda [MathJax TeX-typsnitt](%1). Ladda ner och installera dessa typsnitt f\xF6r att f\xF6rb\xE4ttra din MathJax-upplevelse."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/sv/FontWarnings.js");
